import React, { Component } from 'react'
import '../chat.css'
import emoji from './emoticonos.svg'

export default class Chatcontent extends Component {
    constructor({chat}){
        super()
        console.log(chat)
    }

    render() {
        return (
            <div className="row h-100">
                <div className="w-100 toprow" align="center">
                    <h4 className="mx-auto my-auto">{this.username}</h4>
                </div>

                <div className="w-100 mainrow">
                    <div className="content">

                    </div>

                    <div>
                        <div className="in-msg d-flex justify-content-around">
                            <img src={emoji} width="20"/>
                            <input type="text"/>
                            <span className="text-primary">Send</span>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

Chatcontent.defaultProps = {
    chat: {
        username: '',
        messages: []
    }
}
